            <h2 style="display:inline;">dagboek 22 sept 1969 Henk Winters<br></h2>

         <strong>Over de dagboekpassage van Henk Winters</strong><br><br><i>Henk is een bekendere bewoner van de Kinkerbuurt met een rijke persoonlijke geschiedenis. Door de jaren heen heeft hij een dagboek bijgehouden. Het bestaat uit vele getypte velletjes, keurig verzameld in ettelijke ringbanden, soms gecombineerd met 'corpus delicti' als een treinkaartje, een bonnetje, een krantenartikel of een foto. <br><br>In onderstaande dagboek-passage uit 1969 leest men het verslag van een politie-inval wegens drugsgebruik en een afgedwongen 'coming out'.</i><br><br><br><br>Maandag 22 september 1969 kwart over tien s avonds.<br><br>Ja, ja, het was me wat allemaal. Het is een hele tijd geleden, dat ik iets van me liet horen, maar er is dan ook wel het n en ander gebeurd de afgelopen dagen.  Met het n en ander bedoel ik dan nu niet een heel klein beetje veel, maar een hele boel. <br><br>Al wat nu in het dagboek komt vandaag en morgen en voorlopig de eerste tijd zal verteld worden in Steenwijkerwold. Ja, ja in Steenwijkerwold. Wat is er namelijk gebeurd?<br><br>In het kort het volgende. Het spreekt voor zichzelf dat ik op alle gebeurtenissen van de laatste dagen nog uitgebreid zal terug komen.<br><br>In het kort het volgende:<br><br>Op de avond van mijn verjaardag, precies om kwart voor twaalf s avonds, zwaaide de deur van mijn kamer open en traden 4 mensen  van de Baarnse politie binnen. Jawel!!! Het lang verwachtte was min of meer gebeurd! De politie deed een inval in het Paradiso van Baarn en betrapte ons op het gebruik en het in bezit hebben van stuff. Het is werkelijk te gek, dat dit ons moest gebeuren, maar ja het gebeurde.<br><br>We werden allemaal naar het politiebureau gebracht, waar Jos, Ben, Karel, Marten en ik tot de andere dag drie uur vertoefden in een cel als n van de grootste misdadigers. Ria was er ook nog bij, maar die werd dezelfde nacht nog losgelaten.<br><br>Verdere gebeurtenissen: De andere dag kwamen mn ouders me ophalen. Gesprekken werden gevoerd met: Rechercheurs, inspecteur van politie, de gemeente-secretaris, Irene en dus tot slot met vader en moeder. Afijn het gevolg was dat we dezelfde avond nog in Steenijkerwold arriveerden en daar vertoef ik dan sinds die donderdagavond. In het weekend werd een bezoek gebracht aan: de overburen (Annevelink) en aan mn drie zusters.<br><br>Vandaag ben ik weer terug naar Baarn geweest om reeds wat spullen op te halen, want de kamerbewoning op Julianalaan 9 is uiteraard ook gebeurd. Ik zal waarschijnlijk niet meer op het gemeentehuis komen, maar ik zal ander werk moeten zoeken of eventueel moeten gaan studeren. En dat laatste doe ik dan nog het liefst.<br><br>Ja, het wordt een heel lang verhaal als ik alles moet vertellen en om mij het vertellen een beetje te vereenvoudigen zal ik nu vanaf die bewuste woensdagavond alles in chronologische volgorde opschrijven zodat ik vandaar uit alle gebeurtenissen kan volgen.<br><br>Goed, daar gaan we dan:<br><br>Woensdagavond 17 september: Er komt een groot aantal mensen op bezoek:Ben, Jos, Ria, Marten, Karel met een meisje Annelieke, nog een meisje: Lizzy, Ben van Hattum, Gert-Jan, Eric, Paul en dat waren ze dan. Zelfde avond om kwart voor twaalf: de politie valt binnen en dan zijn nog op de kamer: Ria, Ben, Jos,Karel en Marten en uitraard ikzelf.<br><br>Voor twaalven belandden  we in de cel.<br><br>Om vier s nachts word ik verhoord.<br><br>De andere ochtend word ik om half negen gewekt en word beleefd verzocht om mij te wassen etc.<br><br>Om drie uur s middags mogen we de cel verlaten en mogen we weer vertrekken. Ik echter niet, want mn ouders zijn onderweg. Mn ouders arriveren om half zes op het politiebureau en een uur later vertrekken we naar mn ex-kosthuis. Daar wordt nog gesproken  met mevrouw en meneer Middelink.<br><br>Daarna ( vele dramas hadden plaats gevonden ) vertrekken we naar huis. De andere dag ben ik laat uit bed en ga s middags nog met de bus naar Steenwijk. Ik bel nog met Irene ( die me trouwens nog bezocht in het politiebureau op mijn verzoek ) en s avonds had ik een gesprek met de overburen ( Annevelink ). De andere dag ging ik ook nog weer even naar Steenwijk en s avonds bezochten we mn zuster en zwager in Akkrum. s Middags bezocht ik nog een demonstratie voor de VREDE in Gelderingen ( Steenwijkerwold ).<br><br>De andere dag bezochten we mn zusters in Oldemarkt, die trouwens evenals mn grootmoeder de gehele dag hier op bezoek waren geweest. Goed, zondagsavonds werd in Oldemarkt over de hele zaak gesproken.<br><br>Vandaag ging ik met de auto van mn vader naar Baarn om wat spullen op te halen. Je begrijpt dat het heel wat is en dat er werkelijk ontzettend veel over te vertellen is. Ik wil dan ook ALLES vertellen en het dagboek dat ik tot dusver geschreven heb, heb ik vanmiddag weer teruggekregen van rechercheur Smit van de Baarnse politie. Ik heb het dus weer in mijn bezit en ik moet zeggen, dat dat me wel pijn gedaan heeft, dat ze dat dagboek in beslaggenomen hadden. Al met al was het heel wat.<br><br>Aan alles zijn echter ook nog enige voordelen verbonden, zoals o.a. het feit, dat mn ouders en zusters nu ook weten dat ik homoseksueel ben. Afijn, genoeg stof om blaadjes en blaadjes vol te schrijven en dat zal de eerst komende dagen dan ook ongetwijfeld gebeuren. Voor de mensen van het gemeentehuis ben ik met ziekteverlof en de mensen van de afdeling weten overal van. Die waren trouwens ook helemaal overstuur.<br><br>Tenslotte nog de mededeling, dat Irene en Boomsma binnenkort met elkaar in het huwelijk hopen te treden.<br><br>Tot zover , want ik ga zo naar bed. Ja, dat is de tijd van Steenwijkerwold en morgenochtend wil ik er beslist niet laat uit, want dan moet ik alle rommel die van mn kamer gekomen is uitzoeken. Tot zover en waarschijnlijk ga ik morgenavond nog wel weer verder. Met zekerheid kan ik echter niets zeggen, want de dominee kan ook nog wel op bezoek komen.<br><br>Tot ziens dus. Welterusten.<br><br><br><br>Naschrift: <br><br><i>Henk's ouders hadden al met al weinig problemen met zijn geaardheid, maar voor Henk werd de omgeving te benauwd - kort daarna verhuisde hij naar het opwindende Amsterdam van die tijd. </i><br><br> 
